import * as Styled from './styled'

export const LandingPage = () => {
	return (
		<Styled.Container>
			<Styled.LinksContainer>
				<Styled.BarbazulLink></Styled.BarbazulLink>
				<Styled.LourdesLink></Styled.LourdesLink>
			</Styled.LinksContainer>
		</Styled.Container>
	)
}
